+ (NSDictionary *)drawLine2WithOptions:(MysticChoice *)choice;
{
    CGRect frame = !CGRectUnknownOrZero(choice.frame) ? choice.frame : CGRectSize(choice.size);

    //// Rectangle Drawing
    UIBezierPath* rectanglePath = [UIBezierPath bezierPathWithRect: CGRectMake(CGRectGetMinX(frame), CGRectGetMinY(frame), CGRectGetWidth(frame), CGRectGetHeight(frame))];
    return @{@"paths": @[rectanglePath]};
    
}


